import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation
import './index.css'; // Assuming Header's specific CSS

// Header component now accepts an onNavigate prop
const Header = ({ onLogout, onNavigate }) => {
  return (
    <header className="header-container">
      <div className="header-logo">
        <Link to="/dashboard" onClick={() => onNavigate('upload')}> {/* Link to dashboard home */}
          <img src="/WebsiteLogo.png" alt="GarudaTax AI Logo" className="logo-image" />
          <span className="logo-text">GarudaTax AI</span>
        </Link>
      </div>
      <nav className="header-nav">
        {/* Use onClick with onNavigate prop for internal dashboard navigation */}
        <a href="#" className="nav-link" onClick={() => onNavigate('about')}>About Us</a>
        <a href="#" className="nav-link" onClick={() => onNavigate('history')}>History</a>
        <a href="#" className="nav-link" onClick={() => onNavigate('support')}>Contact Us</a>
        <button className="nav-button" onClick={onLogout}>Logout</button>
      </nav>
    </header>
  );
};

export default Header;
